import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { index } from './pages/index';

function App() {
  return (
    <Router>
      <Switch>
        <Route component={index} path='/' />
      </Switch>
    </Router>
  );
}

export default App;
